def _convert_key(self, key, is_setter: bool = False):
    """
    Require the keys to be the same type as the index.
    """
    # allow arbitrary setting
    if is_setter:
        return list(key)

    for ax, i in zip(self.obj.axes, key):
        if isinstance(i, (int, np.int64, np.int32)):
            if not ax.is_integer():
                raise ValueError(
                    "At based indexing on a non-integer index can only have non-integer indexers"
                )
        elif isinstance(i, (float, np.float64)):
            if not ax.is_floating():
                raise ValueError(
                    "At based indexing on a non-float index can only have non-float indexers"
                )
        else:
            if not ax.is_non_numeric():
                raise ValueError(
                    "At based indexing on a non-numeric index can only have non-numeric indexers"
                )
    return key
